import React from "react";

const Crews = (props) => {
  return (
    <div style={{ marginTop: "90px" }} className="card bg-black">
      <h5 className="title text-info">{props.name}  agency:{props.agency}</h5>
      <p className="description text-info mb-0">{props.agency}</p>
      <img
        src={props.image}
        className="rounded mx-auto d-block  bg-dark"
        alt="..."
        style={{ width: "400px", height: "400px" }}
      />
    </div>
  );
};

export default Crews;
